import axios from 'axios';
import { vehiclesActions } from '../slices/vehiclesSlice';

const fetchVehiclesLocations = () => {
    const fetchVehiclesLocationsThunk = async (dispatch) => {
        const fetchData = async () => {
            const response = await axios.get(`${process.env.API_URL}/vehicles`);
            return response.data;
        };
        try {
            const vehiclesLocations = await fetchData();
            dispatch(vehiclesActions.getVehiclesLocations(vehiclesLocations));
        } catch (error) {
            console.log(error);
        }
    };

    return fetchVehiclesLocationsThunk;
};
